import React, { PureComponent } from "react";
import {
  Radar,
  RadarChart,
  PolarGrid,
  PolarAngleAxis,
  PolarRadiusAxis,
} from "recharts";
import Data from "../Data/DimensionContent";

const data = [
  {
    subject: "การวิเคราะห์ข้อมูล",
    A: parseFloat(Data[0].d0),
    fullMark: 100,
  },
  {
    subject: "การปฏิสัมพันธ์กับผู้อื่น",
    A: parseFloat(Data[1].d0),

    fullMark: 100,
  },
  {
    subject: "การบริหารจัดการข้อมูล",
    A: parseFloat(Data[2].d0),
    fullMark: 100,
  },
  {
    subject: "การใช้อุปกรณ์",
    A: parseFloat(Data[3].d0),
    fullMark: 100,
  },
  {
    subject: "การเป็นผู้นำ",
    A: parseFloat(Data[4].d0),
    fullMark: 100,
  },
  {
    subject: "การประเมินทรัพยากร",
    A: parseFloat(Data[5].d0),
    fullMark: 100,
  },
  {
    subject: "การบริหารทรัพยากร",
    A: parseFloat(Data[6].d0),
    fullMark: 100,
  },
  {
    subject: "การจัดระบบงาน",
    A: parseFloat(Data[7].d0),
    fullMark: 100,
  },
  {
    subject: "การจัดการความสัมพันธ์บุคล",
    A: parseFloat(Data[8].d0),
    fullMark: 100,
  },
];

export default class Example extends PureComponent {
  static jsfiddleUrl = "https://jsfiddle.net/alidingling/6ebcxbx4/";

  render() {
    return (
      <RadarChart
        cx={300}
        cy={250}
        outerRadius={150}
        width={500}
        height={500}
        data={data}
      >
        <PolarGrid />
        <PolarAngleAxis dataKey="subject" />
        <PolarRadiusAxis />
        <Radar
          name="Mike"
          dataKey="A"
          stroke="#8884d8"
          fill="#8884d8"
          fillOpacity={0.6}
        />
      </RadarChart>
    );
  }
}
